export default class BookStoreService {
    getBooks() {
        return [
            {id:1, name: 'Сказки', author: 'Alex Hitch', price: '200$'},
            {id:2, name: 'Комиксы', author: 'Boris Godunov', price: '300$'},
            {id:3, name: 'Анекдоты', author: 'Mary Strict', price: '150$'},
        ]
    }
}
